import React, { useState, useEffect, useRef } from 'react';
import { useSelector, useDispatch } from 'react-redux';

import Question from './Question';

import _ from 'lodash'

const QuestionBox = (props) => {
   const {questionIdArray, filteredVerbs, displayQuestion} = props

   const selectedVerb = (i) => filteredVerbs.find(el => el.id === i)

   if (displayQuestion) {
      return (
         // <div>We have verbs</div>
         // <div>{QuestionArray()}</div>
         <div>{questionIdArray.map((id, index) => <Question verb={selectedVerb(id)} index={index} key={index} />)}</div>
      )
   } else return null
}

export default QuestionBox
